data-full-url=\"https://s.w.org/images/core/5.8/nature-above-02.jpg\" data-link=\"#\" /></figure></li></ul></figure>\n<!-- /wp:gallery -->\";}i:4;O:8:\"stdClass\":7:{s:2:\"id\";i:2149;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:28:\"Dwie kolumny tekstu i tytuł\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:2494:\"\n<h2 style=\"font-size:38px;line-height:1.4\"><strong>Podróż rozpoczęła się szczęśliwie, przy błękitnym niebie i spokojnym morzu.</strong></h2>\n\n\n\n<div class=\"wp-container-12 wp-block-columns\">\n<div class=\"wp-container-10 wp-block-column\">\n<p style=\"font-size:18px\">Weszli za nią na pokład. Dym i domy zniknęły, a statek znajdował się na szerokiej przestrzeni morza, bardzo świeżego i czystego, choć bladego we wczesnym świetle. Zostawili zabłocony Londyn. Bardzo cienka linia cienia zwężała się na horyzoncie, ledwie na tyle gruba, by wytrzymać ciężar Paryża, który jednak na niej spoczywał. Byli wolni od dróg, wolni od ludzi, i ta sama radość z wolności ogarnęła ich wszystkich.</p>\n</div>\n<style>.wp-container-10 > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-10 > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-10 > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-10 > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-10 > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style>\n\n\n<div class=\"wp-container-11 wp-block-column\">\n<p style=\"font-size:18px\">Statek płynął spokojnie przez małe fale, które uderzały w niego, a potem rozchodziły się jak musująca woda, pozostawiając po obu stronach niewielką granicę bąbelków i piany. Bezbarwne październikowe niebo było cienko zachmurzone, jakby przez smugę dymu z ogniska, a powietrze było cudownie słone i rześkie. Rzeczywiście było zbyt zimno, by stać w miejscu. Pani Ambrose objęła ramieniem swego męża, a gdy ruszyli, można było poznać po sposobie, w jaki jej pochylony policzek zwrócił się ku jego, że ma coś prywatnego do zakomunikowania.\n </p>\n</div>\n<style>.wp-container-11 > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-11 > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-11 > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-11 > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-11 > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style></div>\n<style>.wp-container-12 {display: flex;gap: var( --wp--style--block-gap, 0.5em );flex-wrap: nowrap;align-items: center;}.wp-container-12 > * { margin: 0; }</style>\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":6:{s:10:\"spay_email\";s:0:\"\";s:13:\"wpop_keywords\";s:0:\"\";s:16:\"wpop_description\";s:53:\"Dwie kolumny tekstu poprzedzone długim nagłówkiem.\";s:19:\"wpop_viewport_width\";i:1200;s:16:\"wpop_block_types\";a:0:{}s:11:\"wpop_locale\";s:5:\"pl_PL\";}s:14:\"category_slugs\";a:2:{i:0;s:7:\"columns\";i:1;s:4:\"text\";}s:13:\"keyword_slugs\";a:1:{i:0;s:4:\"core\";}s:15:\"pattern_content\";s:1725:\"<!-- wp:heading {\"style\":{\"typography\":{\"fontSize\":38,\"lineHeight\":\"1.4\"}}} -->\n<h2 style=\"font-size:38px;line-height:1.4\"><strong>Podróż rozpoczęła się szczęśliwie, przy błękitnym niebie i spokojnym morzu.</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":18}}} -->\n<p style=\"font-size:18px\">Weszli za nią na pokład. Dym i domy zniknęły, a statek znajdował się na szerokiej przestrzeni morza, bardzo świeżego i czystego, choć bladego we wczesnym świetle. Zostawili zabłocony Londyn. Bardzo cienka linia cienia zwężała się na horyzoncie, ledwie na tyle gruba, by wytrzymać ciężar Paryża, który jednak na niej spoczywał. Byli wolni od dróg, wolni od ludzi, i ta sama radość z wolności ogarnęła ich wszystkich.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":18}}} -->\n<p style=\"font-size:18px\">Statek płynął spokojnie przez małe fale, które uderzały w niego, a potem rozchodziły się jak musująca woda, pozostawiając po obu stronach niewielką granicę bąbelków i piany. Bezbarwne październikowe niebo było cienko zachmurzone, jakby przez smugę dymu z ogniska, a powietrze było cudownie słone i rześkie. Rzeczywiście było zbyt zimno, by stać w miejscu. Pani Ambrose objęła ramieniem swego męża, a gdy ruszyli, można było poznać po sposobie, w jaki jej pochylony policzek zwrócił się ku jego, że ma coś prywatnego do zakomunikowania.\n </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\";}i:5;O:8:\"stdClass\":7:{s:2:\"id\";i:2208;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:48:\"Dwie kolumny tekstu z przesuniętym nagłówkiem\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:5158:\"\n<div class=\"wp-container-20 wp-block-group alignfull has-background\" style=\"background-color:#f2f0e9\">\n<div style=\"height:70px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<div class=\"wp-container-15 wp-block-columns alignwide are-vertically-aligned-center\">\n<div class=\"wp-container-13 wp-block-column\" style=\"flex-basis:50%\">\n<p class=\"has-text-color\" style=\"color:#000000;font-size:30px;line-height:1.1\"><strong>Oceaniczna inspiracja</strong></p>\n</div>\n<style>.wp-container-13 > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-13 > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-13 > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-13 > * { margin-block-start: 0; 