o znajdują się zawsze w jednym miejscu, ale także pojawiają się w menu witryny (w większości motywów). Większość użytkowników zaczyna od strony z informacjami o sobie, która zapozna ich przed odwiedzającymi witrynę. Taka strona może zawierać na przykład taką treść:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Cześć! Za dnia jestem kurierem rowerowym, nocą próbuję swoich sił w aktorstwie, a to jest moja witryna. Mieszkam w Krakowie, mam wspaniałego psa który wabi się Reks i lubię piña coladę (oraz spacery, gdy pada deszcz).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...albo coś takiego:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Firma XYZ Doohickey została założona w 1971 roku i od tamtej pory dostarcza społeczeństwu dobrej jakości gadżety. Znajdująca się w Gotham City XYZ zatrudnia ponad 2000 osób i robi niesamowite rzeczy dla społeczności Gotham.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Jako nowy użytkownik WordPressa, powinieneś przejść do <a href=\"http://example-w1.test/wp-admin/\">swojego kokpitu</a> aby usunąć tę stronę i stworzyć nowe z własną treścią. Dobrej zabawy!</p>\n<!-- /wp:paragraph -->','Home','','inherit','closed','closed','','2-revision-v1','','','2022-06-27 19:21:56','2022-06-27 17:21:56','',2,'http://example-w1.test/?p=253',0,'revision','',0),(258,1,'2022-06-27 19:27:55','0000-00-00 00:00:00','','Automatycznie zapisany szkic','','auto-draft','closed','open','','','','','2022-06-27 19:27:55','0000-00-00 00:00:00','',0,'http://example-w1.test/?page_id=258',0,'page','',0),(261,1,'2022-06-27 19:29:03','0000-00-00 00:00:00','','Automatycznie zapisany szkic','','auto-draft','closed','closed','','','','','2022-06-27 19:29:03','0000-00-00 00:00:00','',0,'http://example-w1.test/?page_id=261',0,'page','',0),(263,1,'2022-06-27 19:30:56','0000-00-00 00:00:00','','Automatycznie zapisany szkic','','auto-draft','closed','op